import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav style={{ padding: '10px', backgroundColor: '#007bff', color: 'white' }}>
      <ul style={{ listStyle: 'none', display: 'flex', justifyContent: 'space-around' }}>
        <li><Link to="/" style={{ color: 'white', textDecoration: 'none' }}>Inventory</Link></li>
        <li><Link to="/recipes" style={{ color: 'white', textDecoration: 'none' }}>Recipes</Link></li>
        <li><Link to="/shopping-list" style={{ color: 'white', textDecoration: 'none' }}>Shopping List</Link></li>
        <li><Link to="/AIRecipe" style={{color: 'white', textDecoration: 'none' }}>Recipe Recommendations</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
